export class Datas {
	constructor(url, id) {
		this.url = url;
		this.id = id;
		this.datas = [];
	}

	getUserDatas() {
		fetch(this.url + this.id, {
			method: 'GET',
		})
			.then((response) => response.json())
			.then((data) => {
				this.datas.push(data);
				console.log(data);
			})
			.catch((error) => console.log(error))
			.finally(() => {
				return this.datas;
			});
	}
}
